Project only nested objects in mongodb for dynamic field names - extension of original question<p>I am querying a database with a structure almost exactly like the data described in <a href="https://stackoverflow.com/questions/61952309/project-only-nested-objects-in-mongodb-for-dynamic-field-names/61958290#61958290">this question</a>, with dynamic field names.</p>
<pre><code>{
  id: 1,
  name: &quot;N1&quot;,
  tasks: {
    project1: {
      task7: {
        count: 10
        time: 1.2
      },
      task3: {
        count: 56
        time: 1050
      }
    },
    project25: {
      task7: {
        count: 25
        time: 10
      }
    }
  }
}
</code></pre>
<p><a href="https://mongoplayground.net/p/FxjR150tZhx" rel="nofollow noreferrer">This code</a> provided in an answer does almost exactly what I need to do, except that I would like to project all fields within task7 (i.e., count and time), not just count. Code copy-pasted here:</p>
<pre><code>db.collection.aggregate([
  {
    $project: {
      _id: 0,
      tasks: {
        $objectToArray: &quot;$tasks&quot;
      }
    }
  },
  {
    $match: {
      &quot;tasks.v.task7&quot;: {
        $exists: true
      }
    }
  },
  {
    $project: {
      tasks: {
        $arrayToObject: {
          $filter: {
            input: {
              $map: {
                input: &quot;$tasks&quot;,
                in: {
                  &quot;k&quot;: &quot;$$this.k&quot;,
                  &quot;v&quot;: &quot;$$this.v.task7.count&quot;
                }
              }
            },
            cond: &quot;$$this.v&quot;
          }
        }
      }
    }
  }
])
</code></pre>
<p>Could anyone help me tweak the code so that I can retrieve more than one field? I have been trying to, but I am a novice, and so far no luck.</p>
<p>UPDATE: It would be great if I could get the output so that documents are nested under each id, and look something like below:</p>
<pre><code>  {
    &quot;id&quot;: 1,
    &quot;name&quot;: &quot;N1&quot;,
    &quot;tasks_project1&quot;: {
        &quot;k&quot;: &quot;task7&quot;,
